"use strict";(self.webpackChunkdocusaurus_wiki=self.webpackChunkdocusaurus_wiki||[]).push([[2481],{5651:(e,t,u)=>{u.r(t),u.d(t,{assets:()=>l,contentTitle:()=>a,default:()=>d,frontMatter:()=>o,metadata:()=>i,toc:()=>p});var n=u(7462),r=(u(7294),u(3905)),s=(u(6256),u(3767));const o={title:"A\xe9ronaute"},a=void 0,i={unversionedId:"roles/aeronaute",id:"roles/aeronaute",title:"A\xe9ronaute",description:"Description",source:"@site/docs/roles/aeronaute.mdx",sourceDirName:"roles",slug:"/roles/aeronaute",permalink:"/botc-wiki/docs/roles/aeronaute",draft:!1,tags:[],version:"current",frontMatter:{title:"A\xe9ronaute"}},l={},p=[{value:"Description",id:"description",level:3},{value:"Exemples",id:"exemples",level:3},{value:"M\xe9caniques et conseils",id:"m\xe9caniques-et-conseils",level:3},{value:"Bluffer l&#39;A\xe9ronaute",id:"bluffer-la\xe9ronaute",level:3},{value:"Comment conter",id:"comment-conter",level:3}],m={toc:p};function d(e){let{components:t,...u}=e;return(0,r.kt)("wrapper",(0,n.Z)({},m,u,{components:t,mdxType:"MDXLayout"}),(0,r.kt)(s.Z,{AERONAUTE:!0,header:!0,mdxType:"Role"}),(0,r.kt)("h3",{id:"description"},"Description"),(0,r.kt)("p",null,"Chaque nuit, vous apprenez un joueur d\u2019une classe diff\xe9rente de celle de la nuit derni\xe8re. ","[+0 ou +1 Etranger]"," "),(0,r.kt)("p",null,"L'A\xe9ronaute conna\xeet des joueurs qui sont d'un type diff\xe9rent."),(0,r.kt)("h3",{id:"exemples"},"Exemples"),(0,r.kt)("blockquote",null,(0,r.kt)("p",{parentName:"blockquote"},"La premi\xe8re nuit, l\u2019",(0,r.kt)(s.Z,{AERONAUTE:!0,mdxType:"Role"})," apprend Adrien (le Conteur d\xe9signe Adrien). La deuxi\xe8me nuit, l\u2019",(0,r.kt)(s.Z,{AERONAUTE:!0,mdxType:"Role"})," apprend Zariko. La troisi\xe8me nuit, l\u2019",(0,r.kt)(s.Z,{AERONAUTE:!0,mdxType:"Role"})," apprend Florine. La quatri\xe8me nuit, l\u2019",(0,r.kt)(s.Z,{AERONAUTE:!0,mdxType:"Role"})," apprend Laurianne.")),(0,r.kt)("blockquote",null,(0,r.kt)("p",{parentName:"blockquote"},"Jonathan est l\u2019",(0,r.kt)(s.Z,{AERONAUTE:!0,mdxType:"Role"}),". La premi\xe8re nuit, il apprend Jila. La deuxi\xe8me nuit, il apprend Julien. La troisi\xe8me nuit, Jonathan meurt donc il n\u2019apprend plus de joueurs. Jila pr\xe9tend \xeatre le ",(0,r.kt)(s.Z,{MOINE:!0,mdxType:"Role"})," et Julien pr\xe9tend \xeatre le ",(0,r.kt)(s.Z,{GOBELIN:!0,mdxType:"Role"}),". Jonathan suppose qu\u2019il a appris un Villageois et un Sbire mais il se trompe. Jila est le ",(0,r.kt)(s.Z,{LUNATIQUE:!0,mdxType:"Role"})," et Julien est le ",(0,r.kt)(s.Z,{LEVIATHAN:!0,mdxType:"Role"}),". Jonathan a en fait appris un Etranger et un D\xe9mon.")),(0,r.kt)("h3",{id:"m\xe9caniques-et-conseils"},"M\xe9caniques et conseils"),(0,r.kt)("ul",null,(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Gardez votre identit\xe9 secr\xe8te aussi longtemps que possible. Si l\u2019A\xe9ronaute peut survivre 4 nuits (la premi\xe8re incluse) alors il apprend 4 joueurs dont l\u2019un est le D\xe9mon. M\xeame dans une partie \xe0 7 joueurs, \xe7a retire la moiti\xe9 des options. Dans une partie \xe0 15 joueurs, \xe7a r\xe9duit la liste \xe0 moins d\u2019un tiers des joueurs.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"D\xe9voilez-vous t\xf4t si vous ne pensez pas survivre toute la partie. Vous avez ajout\xe9 un Etranger \xe0 la partie mais ce n\u2019est pas une mauvaise chose en soi. Etre capable de croire l\u2019Etranger suppl\xe9mentaire qui se d\xe9voile est tr\xe8s utile pour l\u2019enqu\xeate de votre \xe9quipe. Vous pouvez probablement aider \xe0 confirmer ces Etrangers et cela va former un petit groupe de joueur de confiance. Dans une partie \xe0 8 joueurs, il ne doit y avoir qu\u2019un Etranger mais 2 peuvent se d\xe9voiler comme Etranger. Vous pouvez ensuite vous d\xe9voilez comme A\xe9ronaute et votre r\xf4le semblera cr\xe9dible et donnera aussi du cr\xe9dit aux Etranger. \xc7a fait trois joueurs probablement gentils.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Dans une plus petite partie, il est peu probable qu\u2019il y aura m\xeame 4 nuits. Dans ce cas, votre information ne vous aidera probablement pas \xe0 trouver qui est le D\xe9mon mais elle vous aidera quand m\xeame probablement \xe0 d\xe9terminer deux joueurs de types diff\xe9rents. Si vous apprenez deux joueurs avant de mourir et que l\u2019un d\u2019eux est le ",(0,r.kt)(s.Z,{GOLEM:!0,mdxType:"Role"}),", l\u2019autre joueur ne peut pas \xeatre Etranger et \xe7a laisse 2 chances sur 3 d\u2019\xeatre mal\xe9fique.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"La moiti\xe9 des joueurs que vous apprenez sont gentils et l\u2019autre moiti\xe9, mal\xe9fique. M\xeame si vous devinez pas qui est le D\xe9mon, votre information vous dit que deux de ces joueurs savent qu\u2019ils sont dans la m\xeame \xe9quipe et que les deux autres ne savent pas qu\u2019ils le sont. Vous apprenez 4 joueurs et vous avez observ\xe9 que deux d\u2019entre eux sont de m\xe8ches depuis le d\xe9but pendant que les deux autres n\u2019ont pas interagit du tout. Il est alors tr\xe8s probablement que vous ayez d\xe9couvert le d\xe9mo net un de ses Sbires qui travaillent ensemble.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Dans les plus grandes parties, votre information est tr\xe8s puissante et elle devient de plus en plus puissante avec le temps. Toutefois, m\xeame une s\xe9rie d\u2019informations incompl\xe8te a de la valeur. Par exemple, si vous savez que trois joueurs sont de types diff\xe9rents, vous savez qu\u2019au moins l\u2019un d\u2019eux est mal\xe9fique et qu\u2019au moins l\u2019un d\u2019eux est gentil. Donc vous pouvez en d\xe9duire que toutes les th\xe9ories qui met ces trois personnes dans la m\xeame \xe9quipe sont suspectes car il doit y avoir un Sbire ou un D\xe9mon ici quelque part.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Si vous \xeates empoisonn\xe9 une seule de ces quatre nuits, cela sape l\u2019ensemble des informations des quatre nuits. Souvenez-vous que vous une cible de haute priorit\xe9 pour \xeatre empoisonn\xe9. S\u2019il y a une ",(0,r.kt)(s.Z,{VEUVE_NOIRE:!0,mdxType:"Role"})," ou un ",(0,r.kt)(s.Z,{EMPOISONNEUR:!0,mdxType:"Role"})," en jeu, il est probable qu\u2019il veuille vous empoisonner. Vous aviez de bonnes informations pendant trois nuits diff\xe9rentes mais la nuit o\xf9 vous auriez appris qui est le D\xe9mon, vous \xeates empoisonn\xe9 est vous apprenez un autre Villageois \xe0 la place.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Si vous pouvez confirmer le r\xf4le d\u2019un des joueurs que vous avez vus, vous apprenez que les autres joueurs ne peuvent pas \xeatre du m\xeame type. Si un de ces joueurs est confirm\xe9 comme Villageois gr\xe2ce \xe0 la ",(0,r.kt)(s.Z,{PUCELLE:!0,mdxType:"Role"}),", vous savez que les autres joueurs que vous voyez ne sont pas Villageois.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Si vous \xeates dans une partie qui ne doit pas avoir d\u2019Etrangers par d\xe9faut, essayez de trouver un Etranger car \xe7a vous donnera du cr\xe9dit. Plus particuli\xe8rement, \xe7a sera forc\xe9ment l\u2019Etranger qui vous sera montr\xe9 donc vous saurez que les autres joueurs montr\xe9s ne peuvent pas \xeatre Etrangers.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Faites attention aux r\xf4les avec de capacit\xe9s qui les font consid\xe9r\xe9s comme autre que ce qu\u2019ils sont. Un ",(0,r.kt)(s.Z,{RECLUS:!0,mdxType:"Role"})," peut faussement \xeatre consid\xe9r\xe9 comme un Sbire pour vous et l\u2019",(0,r.kt)(s.Z,{ESPION:!0,mdxType:"Role"})," peut \xeatre faussement consid\xe9r\xe9 comme un Etranger pour vous.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Si un jour, le Conteur vous indique vous-m\xeame, c\u2019est une fantastique information. Cela veut dire que les autres joueurs ne sont pas Villageois et que donc si l\u2019un d\u2019eux pr\xe9tend \xeatre Villageois, vous avez des bonnes raisons de les soup\xe7onner. De plus, la plupart des autres joueurs que vous verrez seront mal\xe9fiques car l\u2019un sera Sbire et l\u2019autre D\xe9mon laissant seulement l\u2019Etranger comme membre de votre \xe9quipe. Vous apprendre comme Villageois est cependant extr\xeamement rare et les Conteurs ne le feront que dans des parties du type teensyville ou si le village a vraiment peu d\u2019informations, ou les deux.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Si le village n\u2019aucune id\xe9e de qui ex\xe9cuter mais veut toujours que quelqu\u2019un meurt, un joueur que vous avez appris n\u2019est pas la pire option. M\xeame si vous pensez qu\u2019il est gentil, vous avez 25% de chances d\u2019avoir le D\xe9mon par hasard. Ces probabilit\xe9s de victoire instantan\xe9s ne sont pas n\xe9gligeables."))),(0,r.kt)("h3",{id:"bluffer-la\xe9ronaute"},"Bluffer l'A\xe9ronaute"),(0,r.kt)("ul",null,(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Rappelez-vous que l\u2019A\xe9ronaute ne re\xe7oit pas un alignement, un r\xf4le ou un type et ne sait pas dans quel ordre les joueurs lui sont montr\xe9s. L\u2019A\xe9ronaute est r\xe9veill\xe9 chaque nuit pour que le Conteur lui d\xe9signe un joueur. Ensuite, il est rendormi.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Rappelez-vous que si vous bluffez A\xe9ronaute, il doit y avoir un Etranger suppl\xe9mentaire en jeu. Vous devriez discuter avec un autre mal\xe9fique qui se d\xe9voilera Etranger pour soutenir votre bluff. Vous pr\xe9tendez \xeatre A\xe9ronaute et un autre joueur pr\xe9tend \xeatre ",(0,r.kt)(s.Z,{MAJORDOME:!0,mdxType:"Role"})," et le village attend un autre Etranger. Le D\xe9mon qui attendait une occasion d\u2019\xeatre dans votre jeu se d\xe9voile comme ",(0,r.kt)(s.Z,{DULCINEE:!0,mdxType:"Role"})," et d\u2019\xeatre m\xe9content d\u2019avoir \xe9t\xe9 incit\xe9 \xe0 se d\xe9voiler.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"L\u2019information d\u2019A\xe9ronaute permet d\u2019indiquer deux joueurs ou plus ne sont pas du m\xeame type. Vous pouvez utilisez cette information pour faire passer des joueurs gentils pour mal\xe9fiques. Deux joueurs se d\xe9voilent comme Villageois mais vous r\xe9v\xe9lez ensuite \xeatre A\xe9ronaute et avoir eu ces deux joueurs donc si vous dites la v\xe9rit\xe9, un de ces joueurs ment (bien s\xfbr c\u2019est vous qui mentez mais ils ne savent pas \xe0 ce moment-l\xe0). Un joueur pr\xe9tend \xeatre le ",(0,r.kt)(s.Z,{MAIRE:!0,mdxType:"Role"})," et un autre le ",(0,r.kt)(s.Z,{CHASSEUR_DE_PRIMES:!0,mdxType:"Role"}),", vous pouvez sugg\xe9rer que l\u2019un des deux ment car votre information les inclue tous les deux.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Soyez tr\xe8s prudent sur les joueurs que vous choisissez. Pr\xe9tendre maladroitement que des joueurs sont dans vos information peut accidentellement impliquer que vous ou votre D\xe9mon ce qui vous laissera en difficult\xe9 si vous devez changer votre histoire.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"L\u2019A\xe9ronaute est vraiment un bon bluff de secours si vous ne savez pas quoi bluffer initialement. L\u2019A\xe9ronaute a de bonnes raisons d\u2019essayer de se cahier est m\xeame jusqu\u2019au jour final. Il essaye de passer sous le radar pendant 4 nuits.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Comme l\u2019A\xe9ronaute apprend normalement qui est le D\xe9mon s\u2019il reste en vie 4 nuits, vous pouvez indiquer 4 joueurs dont aucun ne serait le D\xe9mon. Toutefois, si vous faites cela, vous allez indirectement accuser deux joueur d\u2019\xeatre mal\xe9fiques. S\u2019il y a un autre Sbire en jeu, vous pouvez peut-\xeatre le jeter sous le bus pour que votre information soit plus cr\xe9dible car \xe7a n\u2019a pas d\u2019importance tant que vos fausses pistes sur qui est le D\xe9mon tiennent.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Quand vous d\xe9signez du doigt les 4 joueurs, assurez-vous de d\xe9signer un Etranger. Si vous oubliez de le faire, vous pourriez vous contredire vous-m\xeame en disant avoir ajout\xe9 un Etranger sans en avoir un d\u2019inclus dans vos informations.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Quand vous d\xe9signez du doigt les quatre joueurs, assurez-vous que l\u2019un d\u2019eux reste vivant si vous voulez aussi rester vivant. Apr\xe8s que les quatre joueurs soient morts, le village saura que vous mentez car le D\xe9mon \xe9tait suppos\xe9 \xeatre un des quatre joueurs morts.")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("p",{parentName:"li"},"Si les gens croient que vous \xeates l\u2019A\xe9ronaute, vous pouvez faire tuer huit joueurs gentils. Un joueur que vous indiquez chaque jour et une attaque du D\xe9mon la nuit. Ceci constitue une victoire quasi assur\xe9e pour les mal\xe9fiques. Envoyer huit joueurs \xe0 la tombe est incroyablement utile et c\u2019est bien plus d\xe9vastateur que ce que d\u2019autres r\xf4les peuvent faire. Le v\xe9ritable A\xe9ronaute peut faire ex\xe9cuter quatre joueur, dont deux que vous voulez aussi ex\xe9cuter. Mais un faux A\xe9ronaute peut faire ex\xe9cuter quatre joueurs que vous voulez ex\xe9cuter."))),(0,r.kt)("h3",{id:"comment-conter"},"Comment conter"),(0,r.kt)("p",null,'Quand vous mettez les jetons de r\xf4le dans le sac, vous pouvez retirez un Villageois et ajoutez un Etranger \xe0 la place. Chaque nuit, y compris la premi\xe8re, r\xe9veillez l\u2019A\xe9ronaute et d\xe9signez-lui un joueur (vivant ou mort) et placez le jeton de rappel correspondant "Vu Villageois/Etranger/Sbire/D\xe9mon" devant son jeton de r\xf4le pour vous assurer de ne pas donner deux fois le m\xeame type (ne retirez pas les jetons de rappel une fois plac\xe9s). Ne lui indiquez pas un jeton de r\xf4le ou le type de r\xf4le de ce joueur. D\xe9signez simplement le joueur.'),(0,r.kt)("p",null,"A chaque nuit suivante, vous aurez donc de moins en moins de type \xe0 montrer car il n\u2019y a plus que les jetons de rappel restants \xe0 placer. Il est l\xe9gitime de montrer le m\xeame joueur \xe0 l\u2019A\xe9ronaute plus d\u2019une fois si ce joueur a \xe9t\xe9 plusieurs types de r\xf4le au moment du choix ou s\u2019il peut \xeatre consid\xe9r\xe9 comme diff\xe9rents types. Bien que les voyageurs soient un autre type de r\xf4le, il n\u2019est dans le but du r\xf4le de montrer des voyageurs, juste pour augmenter le nombre de nuits n\xe9cessaires \xe0 l\u2019A\xe9ronaute pour avoir l\u2019ensemble de ses informations donc ne le faites pas."),(0,r.kt)("p",null,"S\u2019il n\u2019y a pas de r\xf4les d\u2019un type donn\xe9 en jeu et que vous avez montr\xe9 \xe0 l\u2019A\xe9ronaute tous les autres types de r\xf4les, arr\xeater de r\xe9veiller l\u2019A\xe9ronaute. Notez que m\xeame si un type de r\xf4le est manquant rentre en jeu une nuit apr\xe8s que vous ayez arr\xeat\xe9 de r\xe9veille l\u2019A\xe9ronaute, vous ne le r\xe9veillez pas \xe0 nouveau pour lui montrer ce joueur. La capacit\xe9 de l\u2019A\xe9ronaute a \xe9t\xe9 r\xe9solue d\xe8s que vous avez arr\xeat\xe9 de le r\xe9veiller."),(0,r.kt)("p",null,(0,r.kt)("strong",{parentName:"p"},"Compl\xe9ments Conteur")),(0,r.kt)("p",null,"Ivresse/Empoisonnement : Placez un jeton de rappel pr\xe8s d'un jeton de r\xf4le qui ne correspond pas au type du r\xf4le et montrez ce joueur \xe0 l'A\xe9ronaute. Les nuits suivantes, ce jeton de rappel ne bougera pas donc vous ne pourrez pas montrez un joueur avec un r\xf4le de ce type."),(0,r.kt)("p",null,"Changement de r\xf4le : Si un r\xf4le a chang\xe9 depuis le moment o\xf9 vous l'avez montr\xe9 \xe0 l'A\xe9ronaute, ne retirez pas le jeton de rappel. S'il est devenu un type que vous n'avez pas encore montr\xe9, vous pouvez alors remontrer ce joueur et le marquer avec un deuxi\xe8me jeton de rappel."),(0,r.kt)("p",null,(0,r.kt)("strong",{parentName:"p"},"Interactions notables")),(0,r.kt)("ul",null,(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{CHARMEUR_DE_SERPENT:!0,mdxType:"Role"})," : Peut \xeatre montr\xe9 deux fois \xe0 l\u2019A\xe9ronaute, une fois avant et une fois apr\xe8s avoir choisi le D\xe9mon."),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{PREDICATEUR:!0,mdxType:"Role"})," : Un Sbire qui n\u2019a pas de capacit\xe9 est toujours un Sbire donc peut \xeatre montr\xe9 comme tel \xe0 l\u2019A\xe9ronaute."),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{PROFESSEUR:!0,mdxType:"Role"})," / ",(0,r.kt)(s.Z,{SHABALOTH:!0,mdxType:"Role"})," : Si un A\xe9ronaute est ressuscit\xe9, c\u2019est une nouvelle it\xe9ration du r\xf4le donc les jetons de rappels sont r\xe9initialis\xe9s et les informations recommencent depuis le d\xe9but."),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{BRUTE:!0,mdxType:"Role"})," : La brute n\u2019est pas activement choisie par l\u2019A\xe9ronaute donc elle ne le rend pas ivre et est un joueur valide \xe0 montrer."),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{RECLUS:!0,mdxType:"Role"})," : Peut \xeatre montr\xe9 trois fois \xe0 l\u2019A\xe9ronaute : Etranger/ Sbire/ D\xe9mon"),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{ESPION:!0,mdxType:"Role"})," : Peut \xeatre montr\xe9 trois fois \xe0 l\u2019A\xe9ronaute : Villageois/ Etranger/ Sbire"),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{MARIONNETTE:!0,mdxType:"Role"})," : Si la marionnette pense \xeatre l\u2019A\xe9ronaute, un Etranger a quand m\xeame \xe9t\xe9 ajout\xe9."),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{LEGION:!0,mdxType:"Role"})," : Une seule l\xe9gion peut \xeatre mont\xe9 \xe0 l\u2019A\xe9ronaute deux fois. Une fois comme Sbire et une fois comme D\xe9mon."),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{P_TIT_MONSTRE:!0,mdxType:"Role"})," : Un Sbire qui garde le Pp\u2019tit monstre peut \xeatre monstre \xe0 l\u2019A\xe9ronaute deux fois : Une fois comme Sbire et une fois comme D\xe9mon. Notez qu\u2019on peut encore faire mieux. Un Espion qui garde le P\u2019tit monstre peut \xeatre montr\xe9 4 fois \xe0 l\u2019A\xe9ronaute : une fois consid\xe9r\xe9 comme Villageois, une fois comme Etranger, une fois comme lui-m\xeame et une fois comme D\xe9mon par la garde du P\u2019tit monstre. Mais \xe7a ne fait que lui confirmer que c\u2019est l\u2019Espion avec le P\u2019tit monstre donc ce n\u2019est probablement pas \xe0 faire !"),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)(s.Z,{VORTOX:!0,mdxType:"Role"})," : Force de fausses informations donc chaque rappel de l\u2019A\xe9ronaute doit \xeatre plac\xe9 \xe0 c\xf4t\xe9 d\u2019un r\xf4le qui ne correspond pas au type indiqu\xe9.")))}d.isMDXComponent=!0}}]);